import styled from "styled-components";

//styled-components
const TilesContainer = styled.div`
    display: flex;
    justify-content: center;
    flex-wrap: wrap;
`;

const SingleTile = styled.div`
    width: 300px;
    height: 240px;
    margin: 16px;
    border-radius: 5px;
    border: 1px solid #dce0f5;
    box-shadow: 0 0 5px #dce0f5;
`;

//Components
const Tiles = ({ data }: any) => {
    return (
        <TilesContainer>
            {data.map((e: any) => {
                return (
                    <SingleTile>
                        <p>{e.name}</p>
                    </SingleTile>
                );
            })}
        </TilesContainer>
    );
};

export default Tiles;
